import React, { Component } from "react";
import { Container, Row, Col } from "../components/Grid";
import WritingArea from "../components/WritingArea";

class TextEditor extends Component {
  render() {
    return (
      <>
        <Container fluid>
          <Row>
            <Col size="12">
                <AddText />
            </Col>
          </Row>
        </Container>
      </>
    );
  }
}

export default TextEditor;
